script: |
  super -f text -I q1920.spq | sort > q1920.out

inputs:
  - name: q1920.spq
    data: |
      SELECT - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 * - col0 BETWEEN NULL AND + - ( + + 10 ) * + + 77 * col1 * + 97;
  - name: tab0

outputs:
  - name: q1920.out
    data: |
      -1
      -21
      -81
